    robots: robots,
    SearchBox: ''
}

class App extends React.Component {
    render(){
        return(
            <div className = 'tc'>
                <h1>Robo Friends</h1>
                <SearchBox/>
                <CardList robots = {robots} />
            </div>
        )
        }
}

export default App;
